INSERT INTO `documenttype` (`id`, `codigo`, `titulo`, `descripcion`, `fuente`, `created_at`, `updated_at`) VALUES
(1, 'valueForMoneyAnalysis', 'Análisis de valor por dinero', 'Un resumen del análisis del valor por dinero llevado a cabo para el proyecto, junto con figuras de apoyo, cálculos y casos de negocio, basados en resultados de adquisiciones proyectadas o reales.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(2, 'technicalSpecifications', 'Especificaciones Técnicas', 'Información técnica detallada sobre los bienes o servicios a proveer.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(3, 'serviceDescription', 'Descripciones de servicios', 'Una descripción de alto nivel de los servicios', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(4, 'estimatedDemand', 'Demanda estimada', 'Una narrativa que describe la demanda estimada a ser servida (anualmente) por el proyecto.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(5, 'contractDraft', 'Borrador de contrato', 'Un borrador o copia pro-forma del contrato.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(6, 'contractSigned', 'Contrato Firmado', 'Una copia del contrato firmado. Considere proveer tanto un documento legible por computadora (p.ej. PDF original, o formato de Word u Open Document) como un documento separado para páginas firmadas digitalizadas donde sea requerido.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(7, 'feasibilityStudy', 'Estudio de factibilidad', 'Documentación de la evaluación de factibilidad llevada a cabo para este proceso de contratación, proveyendo información sobre los beneficios o costos netos de los bienes, obras o servicios propuestos.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(8, 'environmentalImpact', 'Impacto Ambiental', 'Documentación de las evaluaciones de impacto ambiental (ej. impacto en flora, fauna y bosques, áreas naturales, emisiones de carbono, etc.) y medidas de mitigación (ej. control de contaminación, soluciones bajas en carbono, madera sustentable, etc.) para este proceso de contratación o proyecto.', 'OC4IDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(9, 'finalAudit', 'Auditoría Final', 'Documentación de una auditoría final llevada a cabo al final de la implementación de un contrato.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(10, 'tenderNotice', 'Aviso de Licitación', 'El aviso formal que da los detalles de una licitación. Este puede ser un enlace a un documento descargable, a un sitio web o a una gaceta oficial en la cual se contiene el aviso.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(11, 'evaluationCommittee', 'Detalles de comité de evaluación', 'Información de la constitución del comité de evaluación', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(12, 'requestForQualification', 'Pedido de Calificación', 'El conjunto de documentos emitidos por la entidad compradora que constituye la base de la calificación y potencialmente la pre-selección de candidatos. Los candidatos calificados serán invitados luego a enviar una propuesta (o a entrar a una nueva fase previa a la presentación de ofertas, tales como una fase de diálogo o una fase interactiva).', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(13, 'evaluationCriteria', 'Criterios de Evaluación', 'Documentación sobre cómo se evaluarán las ofertas.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(14, 'minutes', 'Minutas', 'Minutas de reuniones previas a las ofertas, u otras reuniones relevantes.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(15, 'shortlistedFirms', 'Firmas Preseleccionadas', 'Documentación que provee información sobre las firmas preseleccionadas. Se pueden proveer versiones estructuradas de esta información usando la extensión de ofertas.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(16, 'negotiationParameters', 'Parámetros de negociación', 'Una descripción de los parámetros para la negociación con el proponente preferido.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(17, 'evaluationReports', 'Reporte de evaluación', 'Documentación sobre la evaluación de las ofertas y la aplicación de los criterios de evaluación, incluyendo la justificación para la adjudicación', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(18, 'contractGuarantees', 'Garantías', 'Documentación de garantías relacionadas con el proceso de contratación o el contrato.', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(19, 'defaultEvents', 'Faltas', 'Información de los eventos relacionados con faltas', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(20, 'termination', 'Terminación', 'Información sobre terminación del contrato', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(21, 'performanceReport', 'Reporte (informe) de desempeño', 'Reportes (informes) de evaluación de desempeño', 'OCDS for PPPs', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(22, 'plannedProcurementNotice', 'Aviso de adquisición planeada', 'Un aviso publicado por la entidad de adquisición acerca de sus planes para una futura compra, también conocida como aviso de información previa. La entidad de adquisición puede usar el aviso de adquisición planeada como un aviso de licitación.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(23, 'awardNotice', 'Aviso de adjudicación', 'El aviso formal que da detalles de la adjudicación del contrato. Esto puede ser un enlace a un documento descargable, una página web, o a una gaceta oficial en la que el aviso está contenido.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(24, 'contractNotice', 'Aviso de contrato', 'El aviso formal que provee detalles de un contrato siendo firmado y válido para empezar la implementación. Este puede ser un enlace a un documento descargable, una página web o a una gaceta oficial en la que el aviso está contenido.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(25, 'completionCertificate', 'Certificado de finalización', 'Un certificado de finalización expedido por la autoridad relevante que provee evidencia de que las obras fueron finalizadas hasta un cierto nivel de calidad. Los certificados de finalización podrían ser relevantes sólo para tipos particulares de procesos de contratación.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(26, 'procurementPlan', 'Plan de adquisiciones', 'Documentación que establece las bases para este proceso de contratación en particular.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(27, 'biddingDocuments', 'Documentos de oferta', 'Documentación para proveedores potenciales, describiendo las metas del contrato (p.ej. bienes y servicios a contratar) y el proceso de envío de propuestas.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(28, 'contractArrangements', 'Arreglos para finalizar un contrato', 'Documentación de los arreglos para terminar el contrato(s).', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(29, 'contractSchedule', 'Calendario del contrato', 'Cualquier documento que contenga términos adicionales, obligaciones o información relacionada con el contrato, tal como un calendario, apéndice, anexo, adenda o adición.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(30, 'physicalProgressReport', 'Reportes de progreso físico', 'Documentación sobre el estado de la implementación, usualmente comparado con hitos clave.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(31, 'financialProgressReport', 'Reportes de progreso financiero', 'Documentación que provee fechas y montos de pagos realizados (contra el monto total) y el origen de esos pagos, incluyendo excesos de costos, si los hay. Se pueden proveer versiones estructuradas de esta información a través de las transacciones de implementación del contrato.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(32, 'hearingNotice', 'Aviso de audiencia pública', 'Documentación de cualquier audiencia que ocurrió como parte de la planeación de este proceso de contratación.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(33, 'marketStudies', 'Estudios de mercado', 'Documentación de cualquier estudio de mercado que haya ocurrido como parte de la planeación de este proceso de contrato.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(34, 'eligibilityCriteria', 'Criterios de elegibilidad', 'Documentos detallados sobre la elegibilidad de los licitantes.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(35, 'clarifications', 'Aclaraciones a las preguntas de los licitantes', 'Documentación que provee las respuestas a las cuestiones apuntadas en reuniones pre-ofertas o procesos de preguntas.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(36, 'assetAndLiabilityAssessment', 'Evaluación de los activos y responsabilidades del gobierno', 'Documentación que cubre las evaluaciones de los activos y responsabilidades del gobierno relacionados con este proceso de contratación.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(37, 'riskProvisions', 'Cláusulas para el manejo de riesgos y responsabilidades', 'Documentación que cubre cómo se manejarán los riesgos como parte de este proceso de contratación.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(38, 'winningBid', 'Oferta ganadora', 'Documentación de la oferta ganadora, incluyendo, cuando aplique, una copia completa de la oferta recibida.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(39, 'complaints', 'Quejas y decisiones', 'Documentación de cualquier queja recibida o decisiones en respuesta a dichas quejas.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(40, 'contractAnnexe', 'Anexos al contrato', 'Copias de anexos y otra documentación de soporte relacionados con el contrato.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(41, 'subContract', 'Subcontratos', 'Documentación que detalla los subcontratos y/o provee una copia de los subcontratos. Donde haya datos de OCDS sobre los subcontratos, puede declararse usando el bloque de relatedProcess.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(42, 'needsAssessment', 'Evaluación de necesidades', 'Documentación de la evaluación de necesidades llevada a cabo para este proceso de contratación o proyecto, aborda la demanda para el proyecto o inversión para las comunidades afectadas o usuarios.', 'OC4IDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(43, 'projectPlan', 'Plan de proyecto', 'Documentación de la planeación de proyecto para este proceso de contratación y, donde aplique, una copia del documento del plan de proyecto', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(44, 'billOfQuantity', 'Estimación cuantitativa', 'Documentación que provee la información desglosada de materiales, partes y mano de obra y los términos y condiciones para su provisión, dando información que permitirá a los licitadores dar efectivamente un precio. Se pueden proveer versiones estructuradas de artículos y cantidades en la etapa de licitación, adjudicación y contrato usando las unidades dentro del bloque de artículos.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(45, 'bidders', 'Información de Licitante', 'Documentación sobre los oferentes o participantes, sus documentos de validación y cualquier excepción de procedimientos para el cual califiquen.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(46, 'conflictOfInterest', 'Conflicto de interés', 'Documentación de conflictos de interés declarados o descubiertos.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(47, 'debarments', 'Inhabilitaciones', 'Documentación de cualquier inhabilitación efectuada.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(48, 'illustration', 'Ilustraciones', 'Imágenes destinadas a proveer información de soporte. La URL para imágenes debería estar dirigida directamente a un archivo de imagen que las aplicaciones puedan desplegar como parte de una galería de imágenes. En la fase de licitación, las imágenes pueden ser ilustraciones de bienes, trabajos o servicios requeridos o a la venta. En la fase de implementación, las imágenes pueden ser ilustraciones o evidencia visual de progreso físico.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(49, 'submissionDocuments', 'Documentos de presentación de oferta', 'Documentación enviada por un licitante como parte de su oferta', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(50, 'contractSummary', 'Resumen del contrato', 'Documentación que da una imagen general de los términos y secciones clave del contrato. Comúnmente usado para contratos largos y complejos.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(51, 'cancellationDetails', 'Detalles de cancelación', 'Documentación de los acuerdos, o razones, para la cancelación de un proceso de contratación, adjudicación o contrato específico.', 'OCDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(52, 'projectScope', 'Alcance del proyecto', 'Una descripción de los principales resultados del proyecto que serán llevados a construcción (incluyendo tipo, cantidad y unidades)', 'OC4IDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(53, 'landAndSettlementImpact', 'Impacto en tierras y reasentamientos', 'Indica la cantidad de tierras y propiedades que fueron adquiridas para el proyecto (ej. 25km² de tierras), y resume los impactos relacionados (ej. problemas arqueológicos (se relocalizó un cementerio sajón), asentamientos locales/indígenas (se relocalizaron 5 aldeas indígenas de 500 habitantes cada una), impactos en negocios locales (ej. se compraron 30 propiedades comerciales)).', 'OC4IDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(54, 'projectEvaluation', 'Evaluación del proyecto', 'Generalmente publicado al terminar un proyecto, provee un resumen técnico y financiero de la entrega.', 'OC4IDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(55, 'budgetApproval', 'Aprobación del presupuesto', 'Detalles adicionales sobre la aprobación del presupuesto.', 'OC4IDS', '2020-12-07 20:00:02', '2020-12-07 20:00:02'),
(56, NULL, 'Convocatoria', NULL, NULL, NULL, NULL),
(57, NULL, 'Bases', NULL, NULL, NULL, NULL),
(58, NULL, 'Fallo o resolución', NULL, NULL, NULL, NULL),
(59, NULL, 'Anexo Técnico de Validación financiera', NULL, NULL, NULL, NULL),
