(12, 'Primer Sesión Ordinaria 2020 del Grupo Multisectorial de CoST Jalisco', 'La Sesión, tiene como objetivo, dar continuidad a los trabajos inherentes al Grupo Multisectorial de la Iniciativa de Transparencia en Infraestructura &quot;CoST Jalisco&quot;; el cual fue instalado el pasado 04 de noviembre del 2019, en Casa Jalisco.', 'Patio de los Naranjos de Palacio de Gobierno del Estado de Jalisco,', '2020-10-08 17:00:00', 'jalisco@infrastructuretransparency.org', 'Publicado', '2021-02-09 23:50:27', '2021-02-09 23:58:52'),
(14, 'Primera Sesión Ordinaria 2021 del Grupo Multisectorial de CoST Jalisco', 'Presentar y aprobar la Plataforma de Divulgación, así como la incorporación de proyectos de obra pública para este 2021 dentro de la iniciativa.', 'Casa Jalisco, (Av. Manuel Acuña 2624, Circunvalación Vallarta, 44600 Guadalajara, Jal.)', '2021-03-12 08:00:00', 'Claudia Patricia Arteaga Arróniz', 'Publicado', '2021-03-09 20:11:05', '2021-03-09 20:12:59');
