(236, 'Escuela primaria', 1, 1, NULL, 353, '20.77264386620899|-103.44455623373506', 'Escuela Primaria Miguel Hidalgo y Costilla / Urbana 1154|', '20.77264386620899|', '-103.44455623373506|', '2021-10-27 06:52:52', '2021-10-27 06:52:52'),
(237, 'La rehabilitación de la lateral dela Avenida Juan Gil Preciado, facilitará el transito vehicular al ser uno de los cruces mas conflictivos al ser terminal del sistema de tren eléctrico urbano y salida de todas las rutas de transporte que sirven para que las personas completen su recorrido a los fraccionamientos de Tesistán, favoreciendo también a las personas que viven en los alrededores de Arcos y Lomas de Zapopan, facilitando sus traslados y asegurando espacios dignos y seguros para caminar por la zona.', 1, 1, NULL, 365, '20.739455|-103.40483', 'testofname2|testofname1|', '20.74291|20.739455|', '-103.40936|-103.40483|', '2021-10-27 23:05:06', '2021-10-27 23:05:06'),
(238, 'La rehabilitación de la Unidad Deportiva de la Colonia de Parque de Tesistán, dignifica y pone a la disposición de la población un espacio lúdico de esparcimiento y deportivo fomentando la activación física y la convivencia en una unidad habitacional de aproximadamente 968 casas habitación.', 1, 1, NULL, 368, '20.7922|-103.46821', 'testofname1|', '20.7922|', '-103.46821|', '2021-10-28 06:56:28', '2021-10-28 06:56:28'),
(239, 'La rehabilitación del parque consiste en la sustitución de los andadores internos, renovación de ejercitadores, poda y reforestación así como la iluminación y mantenimiento general.', 1, 1, NULL, 370, '20.651167|-103.441611', 'testofname2|testofname1|testofname2|testofname1|', '|20.651167||20.651167|', '|-103.441611||-103.441611|', '2021-10-28 22:42:19', '2021-10-29 18:15:03'),
(240, 'La obra es parte de un cambio progresivo de las calles de la colonia, logrando una mejor conectividad vial, así como evitando los problemas de inundaciones y de agua. Las mejoras no solo benefician la circulación de vehículos, si no que mejora la infraestructura hidrosanitaria de la zona ayudando a la circulación del agua pluvial.', 1, 1, NULL, 372, '20.629292293577436|-103.37314009666444', 'testofname2|', '20.629292293577436|20.80899|', '-103.37314009666444|-103.46103|', '2021-10-29 00:42:44', '2021-10-29 18:44:00'),
(241, 'La sustitución de redes hidráulicas y sanitarias de la zona de la Avenida Santa Esther, en una primera etapa pretende beneficiar a 22,500 personas directamente y a mas los indirectos que transitan la Avenida siendo esta una vía de comunicación desde el Centro de Zapopan a las colonias de la zona oriente del municipio, que permitirá agilizar el tráfico, así como sumarse al programa integral de manejo de aguas pluviales que evitará las inundaciones así como el manejo de las aguas negras.', 1, 1, NULL, 374, '20.728289|-103.41025', 'testofname1|', '20.728289|', '-103.41025|', '2021-10-29 05:00:24', '2021-10-29 05:00:24'),
(242, 'La pavimentación en concreto hidráulico de la calle Rubén Darío en la colonia la Coronilla, es una prioridad para poder modernizar y dignificar la infraestructura de las colonias que pertenecen a las zonas de atención prioritarias, sumándose a las intervenciones que ya se han estado realizando durante tres años, para mejorar las vialidades tanto para los vehículos como para las personas que viven en los alrededores.', 1, 1, NULL, 376, '20.762222|-103.327444', 'testofname1|', '20.762222|', '-103.327444|', '2021-10-29 06:16:23', '2021-10-29 06:16:23'),
(243, 'La pavimentación en concreto hidráulico como parte de la modernización de la infraestructura de las colonias de atención prioritaria del municipio, facilitando la movilidad tanto motorizada como no motorizada y el paso de transeúntes por la zona.', 1, 1, NULL, 378, '20.766583|-103.331778', 'testofname1|', '20.766583|', '-103.331778|', '2021-10-29 06:40:12', '2021-10-29 06:40:12'),
(244, 'La pavimentación en concreto hidráulico como parte de la modernización de la infraestructura de las colonias de atención prioritaria del municipio, facilitando la movilidad tanto motorizada como no motorizada y el paso de transeúntes por la zona.', 1, 1, NULL, 380, '20.75481|-103.33274', 'testofname1|', '20.75481|', '-103.33274|', '2021-10-29 07:10:08', '2021-10-29 07:10:08'),
