INSERT INTO `modification_type` (`id`, `codigo`, `titulo`, `descripcion`, `created_at`, `updated_at`) VALUES
(1, NULL, 'Duración', 'Esta modificación describe un cambio a la duración del contrato. Este puede ser identificado en base a los cambios en award.contractPeriod o contract.period, o actualizaciones a hitos y pagos que parezcan exceder el contract.period anticipado.', NULL, NULL),
(2, NULL, 'Valor', 'Esta modificación describe un cambio en el valor del contrato. Esto puede ser identificado en base a cambios en la suma de contract.value (observando los casos en los que el valor de un contrato varía, o se firma un contrato de extensión adicional como parte de este proceso), o monitoreando contract.implementation.transactions.', NULL, NULL),
(3, NULL, 'Alcance', 'Esta modificación describe un cambio al alcance del contrato. Esto puede ser identificado comparando detalles clave de tender, awards y contracts o monitoreando documentos relevantes.', NULL, NULL);
