INSERT INTO `newsletters` (`id`, `title`, `content`, `date`, `img_rute`, `status`, `created_at`, `updated_at`) VALUES
(11, 'Buscan transparentar procesos de proyectos de obras públicas con alianza estratégica entre ITEI, CMIC, CoST y municipios.', '<p><strong>Transparencia, elemento fundamental para inhibir la corrupci&oacute;n en obras p&uacute;blicas.</strong><br />\r\n<br />\r\nLa ma&ntilde;ana de este mi&eacute;rcoles se llev&oacute; a cabo la Conferencia &quot;Transparencia en Insfraestructura P&uacute;blica: herramientas de eficiencia y prevenci&oacute;n de la corrupci&oacute;n&quot;, que imparti&oacute; Manuel Gonz&aacute;lez Caballero quien es gerente para Am&eacute;rica Latina de Construction Sector Transparency Initiative (CoST), al respecto, la Comisionada Presidente del Pleno del Instituto de Transparencia, Informaci&oacute;n P&uacute;blica y Protecci&oacute;n de Datos Personales del Estado de Jalisco (ITEI), Cynthia Patricia Cantero Pacheco, describi&oacute; el papel del ITEI en la iniciativa que pretende fortalecer la visibilidad de los procesos de proyectos de obras p&uacute;blicas.<br />\r\n<br />\r\n&quot;El ITEI lo que est&aacute; haciendo es tratando de incorporarse a esta iniciativa internacional para poder permear esos ejercicios de transparencia en obra p&uacute;blica y de auditor&iacute;a por parte de la sociedad en verificar que las obras p&uacute;blicas que se est&eacute;n llevando a cabo, por aquellas autoridades que se sumen a la iniciativa, est&eacute;n cumpliendo con, para lo que fueron contratadas, en los tiempos, en los t&eacute;rminos que se estableci&oacute; desde la planeaci&oacute;n&quot; explic&oacute;.<br />\r\n<br />\r\nPor su parte, Luis Rafael M&eacute;ndez Jaled, Presidente de la C&aacute;mara Mexicana de la Industria de la Construcci&oacute;n Jalisco (CMIC), se dijo consciente de la percepci&oacute;n en M&eacute;xico del tema de corrupci&oacute;n por lo que tal iniciativa llega justo a tiempo.<br />\r\n<br />\r\n&quot;Habl&aacute;bamos de que M&eacute;xico es de los pa&iacute;ses en los que m&aacute;s existe el tema de corrupci&oacute;n y el tema de la transparencia viene a solucionar esto, en ese sentido, lo que Cynthia est&aacute; teniendo como iniciativa junto con gente de CoST para manejar este tipo de ejercicios, donde es provocar e incentivar el tema de la transparencia, siempre va a ayudar, recordemos que la corrupci&oacute;n no es un tema de uno, es un tema de dos&quot; dijo<br />\r\n<br />\r\nEn su conferencia, el Gerente para Am&eacute;rica Latina de Construction Sector Transparency Initiative (CoST), Manuel Gonz&aacute;lez Caballero, expuso de manera general lo que la iniciativa ha detectado y que sin duda son preocupantes los niveles de corrupci&oacute;n que muchos pa&iacute;ses en Am&eacute;rica Latina han alcanzado, por tanto, se dijo contento de observar el buen &aacute;nimo de quienes se han interesado en tomar en serio la realidad y buscar hacer algo al respecto.<br />\r\n<br />\r\nLa iniciativa CoST pretende adicionar un foro multiactor con sociedad civil, c&uacute;pulas empresariales, el propio ITEI y gobierno, as&iacute; como publicidad de informaci&oacute;n en datos abiertos, generaci&oacute;n de capacidades institucionales y auditor&iacute;as sociales.<br />\r\n<br />\r\nEn la introducci&oacute;n a la tem&aacute;tica, Claudia Arteaga Arr&oacute;niz, destac&oacute; la importancia de llevar a cabo estos ejercicios y reconoci&oacute; el inter&eacute;s de los municipios en participar, pero sobre todo, el inter&eacute;s que varias organizaciones de la sociedad civil han demostrado ante tal iniciativa.<br />\r\n<br />\r\nLos primeros municipios interesados en participar en este primer llamado, son, Guadalajara, Tonal&aacute; y Zapopan.<br />\r\n<br />\r\nPosteriormente a la Conferencia, se llev&oacute; a cabo el &quot;Taller para la implementaci&oacute;n de la Iniciativa de Transparencia en la Construcci&oacute;n&quot; por parte del propio Manuel Gonz&aacute;lez para representantes de Guadalajara, Zapopan, Tonal&aacute;, otros municipios y dependencias de las &aacute;reas de transparencia, inform&aacute;tica, sistemas, obras p&uacute;blicas y contralor&iacute;as, tal iniciativa pretende sumar a esas acciones a otras autoridades, tanto municipales, como estatales, por lo que en el primer acercamiento, se realiz&oacute; una sensibilizaci&oacute;n sobre la importancia de estos temas y los elementos a ser observados por la organizaci&oacute;n.</p>', '2019-09-04 06:00:00', '/news_imgs/1612910307_Boletin1.jpg', 'Publicado', '2021-02-06 01:17:49', '2021-02-09 23:38:27'),
(14, 'Van por transparencia en Obra Pública, observará organización internacional CoST distintas obras en Jalisco con ayuda de grupo multisectorial', '<p><strong>La iniciativa pretende inhibir malas pr&aacute;cticas en contrataciones y mejorar eficiencia de recursos p&uacute;blicos en obras.</strong><br />\r\n<br />\r\nEl Instituto de Transparencia, Informaci&oacute;n P&uacute;blica y Protecci&oacute;n de Datos Personales del Estado de Jalisco (ITEI), Instituto Nacional de Transparencia, Acceso a la Informaci&oacute;n y Protecci&oacute;n de Datos Personales (INAI), Gobierno de Estado de Jalisco, municipios de Guadalajara, Tonal&aacute;, Zapopan y Tlajomulco van juntos en iniciativa Infrastructure Transparency Initiative (CoST) que observar&aacute; Obra P&uacute;blica en la entidad, al respecto, la Presidenta Cynthia Cantero Pacheco, coment&oacute; que la puesta en marcha del grupo multisectorial, fortalecer&aacute;, entre otras cosas, la confianza de la ciudadan&iacute;a en procesos de obra p&uacute;blica.<br />\r\n<br />\r\n&quot;Se fomentar&aacute; el uso de la tecnolog&iacute;a, desarrollando una plataforma en donde se cargar&aacute; informaci&oacute;n focalizada y utilizada potencialmente como herramienta de difusi&oacute;n de estos trabajos que estamos realizando, se busca provocar un cambio positivo en la incorporaci&oacute;n de buenas pr&aacute;cticas que a la postre deriven en actividades que provoquen fortalecer la confianza en los procesos de obra p&uacute;blica a trav&eacute;s de la rendici&oacute;n de cuentas y con la participaci&oacute;n activa de la sociedad representada en el grupo multisectorial de esta mesa&quot; abund&oacute;.<br />\r\n<br />\r\nPor su parte el Gobernador del Estado de Jalisco se&ntilde;al&oacute; que para el gobierno que encabeza es fundamental participar en acciones encaminadas a vigorizar la transparencia y la rendici&oacute;n de cuentas, motivo por el que, decidi&oacute; sumarse a la iniciativa internacional de Infrastructure Transparency Initiative (CoST), y as&iacute; convertirse en la primer entidad en entrar en esa din&aacute;mica.<br />\r\n<br />\r\n&quot;Nosotros en Jalisco creemos que es un momento en el que hay que fortalecer el Sistema Estatal Anticorrupci&oacute;n, un sistema perfectible, con algunas limitaciones, con asuntos que mejorar, pero sin duda la respuesta correcta para que las cosas cambien, y por eso, Gobierno del Estado tom&oacute; la decisi&oacute;n de sumarse (?) a partir de que Cynthia me platic&oacute;, me explic&oacute; todo lo que significaba esta plataforma CoST me pareci&oacute; fundamental hace un esfuerzo y poner sobre la mesa la voluntad de Jalisco de sumarse&quot; explic&oacute;.<br />\r\n<br />\r\nJalisco es la primera entidad de la Rep&uacute;blica Mexicana en sumarse a una iniciativa de tal magnitud y lo har&aacute; con un proyecto anunciado el pasado 3 de octubre para dotar de internet de alta calidad a todo el estado de Jalisco con una inversi&oacute;n inicial de 900 millones de pesos, que podr&iacute;a alcanzar en los 3 a&ntilde;os de ejecuci&oacute;n los 4 mil cien millones de pesos.<br />\r\n<br />\r\nEn su intervenci&oacute;n, el Gerente Regional para Am&eacute;rica Latina de CoST Manuel Gonz&aacute;lez Caballero, se&ntilde;al&oacute; que no s&oacute;lo se trata de una plataforma que d&eacute; a conocer informaci&oacute;n diversa sobre la obra, sino que esa informaci&oacute;n debe ser de calidad, informaci&oacute;n que al ciudadano le sirva para tener certeza sobre lo que se est&aacute; gastando y los resultados.<br />\r\n<br />\r\nPor su parte Edna Jaime, Directora General de M&eacute;xico Eval&uacute;a, reconocida organizaci&oacute;n dedicada a evaluar el ejercicio del gobierno de M&eacute;xico y que busca incidir mediante sus evaluaciones en el dise&ntilde;o de pol&iacute;ticas p&uacute;blicas, destac&oacute; la funci&oacute;n de Cynthia Cantero como factor de cohesi&oacute;n para la suma de esfuerzos entorno a una acci&oacute;n que de llevarse hasta las &uacute;ltimas consecuencias podr&iacute;a resultar como una acci&oacute;n con un gran &quot;poder transformador&quot;.<br />\r\n<br />\r\nPor su parte el Comisionado Joel Salas Su&aacute;rez destac&oacute; que tal iniciativa es un parteaguas que muestra la voluntad de cambio en un tema de suma importancia como lo es la obra p&uacute;blica e infraestructura por lo que la transparencia proactiva en todas las etapas de la misma, sin duda, fortalecer&aacute; la rendici&oacute;n de cuentas, adem&aacute;s, de que al ser observados en todo momento, existir&aacute; mejor calidad en los proyectos.<br />\r\n<br />\r\nEl Presidente Municipal de Zapopan, Pablo Lemus Navarro enfatiz&oacute; que la constante observaci&oacute;n de la ciudadan&iacute;a en las acciones de la autoridad y la transparencia en la licitaci&oacute;n y asignaci&oacute;n de obra son clave para que los gobiernos sean m&aacute;s eficientes, por lo que se dijo convencido de que tal iniciativa traer&aacute; muchos beneficios para los zapopanos.<br />\r\n<br />\r\nEn su intervenci&oacute;n el Presidente Municipal de Guadalajara, Ismael del Toro Castro dijo que con la iniciativa se da un impulso al sector de la construcci&oacute;n desde la l&oacute;gica de la transparencia y la rendici&oacute;n de cuentas con la participaci&oacute;n activa que da mucha m&aacute;s solidez a tal iniciativa.<br />\r\n<br />\r\nAsistieron al evento, quienes formar&aacute;n parte del grupo multisectorial, del Supremo Tribunal de Justicia, su Presidente (STJEJ), Ricardo Suro Esteves; de la Universidad de Guadalajara (UdeG), el Rector General, Ricardo Villanueva Lomel&iacute;; por parte del Comit&eacute; de Participaci&oacute;n Social del Sistema Estatal Anticorrupci&oacute;n, la Presidente del mismo, Luc&iacute;a Almar&aacute;z C&aacute;zarez; de la C&aacute;mara Mexicana de la Industria de la Construcci&oacute;n Cap&iacute;tulo Jalisco (CMIC), el Presidente Luis M&eacute;ndez Jaled; Miguel &Aacute;ngel Landeros Volquarts, Presidente del Consejo Empresarial Mexicano de Comercio Exterior de Occidente (COMCE Occidente); Armando Brenez Moreno, Presidente del Colegio de Ingenieros Civiles del Estado de Jalisco (CICEJ); Omar Enrique Cervantes Rivera, Secretario General del Ayuntamiento de Tlajomulco; Miriam Rubio Vega, S&iacute;ndico del Ayuntamiento de Tonal&aacute; y Jos&eacute; Bautista Far&iacute;as, del Instituto Tecnol&oacute;gico y de Estudios Superiores de Occidente (ITESO) en representaci&oacute;n del Rector Luis Arriaga Valenzuela.<br />\r\n<br />\r\nEstuvieron presentes los comisionados ciudadanos Pedro Antonio Rosas Hern&aacute;ndez y Salvador Romero Espinosa, as&iacute; como, el Secretario Ejecutivo, Miguel &Aacute;ngel Hern&aacute;ndez Vel&aacute;zquez del ITEI; Emilene Mart&iacute;nez Morales, Coordinadora Regional de Sociedad Civil para Am&eacute;rica Latina de la Alianza para el Gobierno Abierto (OGP); David Zamora Bueno, Secretario de Infraestructura y Obra P&uacute;blica del Estado de Jalisco; representantes de medios de comunicaci&oacute;n, regidores, funcionarios estatales, municipales, personal del ITEI y ciudadanos interesados en la tem&aacute;tica.</p>', '2019-11-04 06:00:00', '/news_imgs/1612910546_Boletin2.jpg', 'Publicado', '2021-02-09 23:41:21', '2021-03-16 19:22:11'),
(15, 'Transparencia y rendición de cuentas en infraestructura pública, promovida a través de iniciativa CoST e ITEI en el Estado de Jalisco', '<p><strong>El ITEI impulsa la iniciativa CoST que tiene por objeto promover la transparencia y la rendici&oacute;n de cuentas en todas las etapas de los proyectos de infraestructura y obra p&uacute;blica.</strong><br />\r\n<br />\r\nSe llev&oacute; a cabo la Primera Sesi&oacute;n Ordinaria 2020 del Grupo Multisectorial de CoST Jalisco, la Comisionada Presidente del Instituto de Transparencia, Acceso a la Informaci&oacute;n P&uacute;blica y Protecci&oacute;n de Datos Personales del Estado de Jalisco (ITEI) y Coordinadora de Organismos Garantes de las Entidades Federativas del Sistema Nacional de Transparencia, Cynthia Cantero Pacheco, dio a conocer el cronograma del plan de trabajo, considerando el involucramiento de los enlaces de los Municipios de Guadalajara, Zapopan, Tonal&aacute;, Tlajomulco y el Gobierno del Estado de Jalisco, adem&aacute;s de describir lo que pretende tal iniciativa.<br />\r\n<br />\r\n&quot;Lo que se busca con la iniciativa CoST es aperturar todo el ciclo de la obra p&uacute;blica, desde su planeaci&oacute;n, la proyecci&oacute;n o generaci&oacute;n a trav&eacute;s de proyectos ejecutivos, procesos de licitaci&oacute;n, o procesos que se lleven a cabo para adjudicar las obras p&uacute;blicas y por supuesto los contratos, la participaci&oacute;n de la empresas y finalmente la ejecuci&oacute;n&quot; dijo.<br />\r\n<br />\r\nCoST Jalisco es un proyecto impulsado por el ITEI, &eacute;sta sesi&oacute;n que se llev&oacute; a cabo en Palacio de Gobierno del Estado de Jalisco, tuvo por objeto presentar los avances de la iniciativa de Transparencia en Infraestructura, as&iacute; como la aprobaci&oacute;n del Reglamento Interior, el est&aacute;ndar de indicadores CoST Jalisco, el Mapa de Sitio de la Plataforma de Divulgaci&oacute;n y un banner de incorporaci&oacute;n dentro de sus sitios web institucionales que publicite y redireccione a la p&aacute;gina web de CoST Jalisco.<br />\r\n<br />\r\nCoST Transparency es una iniciativa internacional encargada de promover la transparencia y rendici&oacute;n de cuentas dentro de las diferentes etapas de los proyectos de infraestructura y obra p&uacute;blica, contando con la participaci&oacute;n ciudadana.<br />\r\n<br />\r\nSu objetivo es trabajar directamente con gobierno, sociedad civil y la industria de la construcci&oacute;n para promover la divulgaci&oacute;n, validaci&oacute;n e interpretaci&oacute;n de datos de los proyectos de infraestructura y obra p&uacute;blica.<br />\r\n<br />\r\nAl respecto, Cantero Pacheco sostuvo, &quot;El proyecto de la iniciativa CoST contempla la evaluaci&oacute;n para el cumplimiento de 40 indicadores formar&aacute;n parte de las etapas clave, dentro del ciclo de la infraestructura. Los 40 rubros que la iniciativa de CoST contempla, se encuentran contenidas como obligaciones en la Ley de Transparencia, la diferencia es c&oacute;mo se divulgar&aacute; la informaci&oacute;n, la cual se desarrollar&aacute; bajo est&aacute;ndares de Datos Abiertos, con la finalidad de que la informaci&oacute;n sea de f&aacute;cil acceso y localizaci&oacute;n para el ciudadano&quot;.<br />\r\n<br />\r\nEnfatiz&oacute; que es importante que las autoridades conozcan que los par&aacute;metros de CoST se ajustan a la normativa contenida en la Ley de Transparencia, adem&aacute;s de ser un proyecto que tiene apoyo internacional para su desarrollo al ser considerado ejemplar.<br />\r\n<br />\r\n&quot;Gracias a la colaboraci&oacute;n del Banco de Desarrollo de Am&eacute;rica Latina y los recursos que ha gestionado, se desarrolla actualmente una plataforma, que se contempla en dos fases. La primera la identificaci&oacute;n del proyecto y la segunda fase que contiene el contrato, ser&aacute; observado desde el proyecto de contrataci&oacute;n hasta la finalizaci&oacute;n de la obra&quot;, acot&oacute;.<br />\r\n<br />\r\nHizo notar que el cap&iacute;tulo local de CoST Transparency en Jalisco, se encuentra integrado por un grupo multisectorial con la finalidad de mejorar el valor de las inversiones en infraestructura y obra p&uacute;blica, aumentando la transparencia y la rendici&oacute;n de cuentas.<br />\r\n<br />\r\n&quot;El grupo multisectorial de CoST, observar&aacute; el desarrollo de las obras, se encuentra conformado por Instituciones de Gobierno, del sector privado, del sector acad&eacute;mico y de la sociedad civil, que es la responsable de guiar el desarrollo, la implementaci&oacute;n y supervisi&oacute;n de la iniciativa de CoST en Jalisco&quot; dijo.<br />\r\n<br />\r\n<br />\r\n<br />\r\nEl Secretario de Infraestructura y Obra P&uacute;blica, David Miguel Zamora Bueno, coment&oacute; que la ciudadan&iacute;a merece el desarrollo de un trabajo serio, minucioso y a tiempo, por parte de sus autoridades.<br />\r\n<br />\r\n&quot;En esta pandemia es indispensable llevar certeza a la poblaci&oacute;n, crear empleos. Impulsar la manufactura se refleja de inmediato en la construcci&oacute;n de carreteras y escuelas. Es una firme apuesta de este gobierno&quot; expres&oacute;.<br />\r\n<br />\r\nA su juicio enfatiz&oacute;, que la iniciativa CoST, naci&oacute; como un esfuerzo pionero en el pa&iacute;s, un esfuerzo del Sector Privado, de los Medios de Comunicaci&oacute;n, de la C&aacute;mara de la Industria de la Construcci&oacute;n y del Instituto de Transparencia del Estado de Jalisco ITEI. &quot;Creo que debemos de responder a la gente&quot;.<br />\r\n<br />\r\nEl Gerente Regional Senior para Am&eacute;rica Latina CoST, Manuel Gonz&aacute;lez Caballero, manifest&oacute; su alegr&iacute;a por la atenci&oacute;n que las autoridades, brindan al programa, pero sobre todo por el progreso sobre el cumplimiento de los compromisos planteados en materia de transparencia y combate a la corrupci&oacute;n en obra p&uacute;blica.<br />\r\n<br />\r\n&quot;La reactivaci&oacute;n econ&oacute;mica en el contexto del COVID-19, contempla el impulso de los Gobiernos de fuertes inversiones en infraestructura, es importante para nosotros participar sobre el rumbo que tomar&aacute;n las iniciativas. Felicit&oacute; al ITEI porque ellos est&aacute;n encaminado el desarrollo del programa a trav&eacute;s de un modelo con visi&oacute;n a 5 a&ntilde;os&quot;.<br />\r\n<br />\r\n&quot;Hoy d&iacute;a el trabajo del ITEI es ejemplo y servir&aacute; como modelo para ser aplicado en otros Estados de M&eacute;xico y en otros puntos de Latinoam&eacute;rica&quot;, enfatiz&oacute;.<br />\r\n<br />\r\nPara el Comisionado Presidente del Instituto Nacional de Transparencia (INAI), Francisco Javier Acu&ntilde;a Llamas, hoy d&iacute;a la gesti&oacute;n p&uacute;blica de Jalisco &quot;se encuentra iluminada, producto de un trabajo tenaz desarrollado en un contexto complejo&quot;.<br />\r\n<br />\r\nSostuvo que la idea de un organismo que se hace que se transparente la funci&oacute;n p&uacute;blica, suele ser incomoda para el Gobierno, en d&oacute;nde la presencia de las autoridades de la entidad, acompa&ntilde;ando este proceso y esta iniciativa de CoST en Jalisco, es un gran punto de partida.<br />\r\n<br />\r\n&quot;Esperamos que esta iniciativa CoST, pueda expandirse a otros &aacute;mbitos de la pol&iacute;tica y otros puntos de la Republica, el Pleno del INAI es testigo de este acontecimiento de la vida p&uacute;blica en Jalisco. Las tecnolog&iacute;as de la informaci&oacute;n nos demuestran que nos pueden brindar refugio, hoy generamos nuevas rutas sobre infraestructura p&uacute;blica&quot; explic&oacute;.<br />\r\n<br />\r\nEn ese sentido se refiri&oacute; a la importancia que cobra la infraestructura y sus procesos de ejecuci&oacute;n, mismos que deben estar bien claros.<br />\r\n<br />\r\n&quot;La infraestructura es una de las principales actividades que debe ser escrutada. Cuando un pa&iacute;s es hu&eacute;sped de este tipo de iniciativas democr&aacute;ticas, deben ser valoradas y la ciudadan&iacute;a debe defenderlas para que no surjan espacios de caos (?) la iniciativa CoST nos da certeza y a pesar de las contra olas nos reanima, no importa que la transparencia sea incomoda para los gobernantes, por las constantes preguntas de la ciudadan&iacute;a&quot; abund&oacute;.<br />\r\n<br />\r\nY finaliz&oacute; se&ntilde;alando que es de suma trascendencia el empoderamiento de los ciudadanos con este tipo de ejercicios.<br />\r\n<br />\r\n&quot;Qu&eacute; bueno que sea as&iacute;, que la ciudadan&iacute;a se empodere de la exigencia y participe en la vida p&uacute;blica. Gracias a Cynthia Cantero y a CoST por confiar en Jalisco&quot;, expres&oacute;.<br />\r\n<br />\r\nManifest&oacute; que los mexicanos debemos buscar defender la democracia en el actual contexto y por supuesto que la obra p&uacute;blica ser&aacute; un compensatorio en el mercado, por la desaceleraci&oacute;n provocada por el COVID-19, pero tambi&eacute;n es una oportunidad de generar confianza a trav&eacute;s del uso correcto de las finanzas p&uacute;blicas.<br />\r\n<br />\r\n&quot;En el INAI, vemos con mucho entusiasmo la implementaci&oacute;n de este proyecto en Jalisco&quot; sentenci&oacute;.<br />\r\n<br />\r\nEn su intervenci&oacute;n, el Presidente Municipal de Zapopan, Pablo Lemus Navarro, enfatiz&oacute; que transparentar los recursos p&uacute;blicos es una actividad importante en su administraci&oacute;n por lo que ha sido fundamental contar con el apoyo del ITEI.<br />\r\n<br />\r\n&quot;Desde lo local, en el &aacute;mbito municipal estamos atentos a la necesidad de dinamizar la econom&iacute;a, por ello contemplamos la obra p&uacute;blica, contemplamos generar una pol&iacute;tica contra c&iacute;clica para fortalecer el &aacute;rea econ&oacute;mica y la infraestructura es importante impulsor&quot; explic&oacute;.<br />\r\n<br />\r\nDestac&oacute; que busca que las personas que habitan el Municipio de Zapopan, se queden tranquilas del uso y destino de los recursos p&uacute;blicos y adicionalmente sean participes de una rendici&oacute;n de cuentas, en donde la ciudadan&iacute;a pueda apreciar que beneficios que le deja esa obra p&uacute;blica.<br />\r\n<br />\r\n&quot;Seguiremos trabajando con el ITEI&quot; subray&oacute;.<br />\r\n<br />\r\nEl Presidente Municipal de Tonal&aacute;, Juan Antonio Gonz&aacute;lez Mora, destac&oacute; que, desde el inicio de su administraci&oacute;n, Tonal&aacute; era considerado el cuarto Municipio m&aacute;s endeudado del pa&iacute;s y que con la transparencia pudieron dar vuelta a esa din&aacute;mica nociva para el municipio.<br />\r\n<br />\r\n&quot;parec&iacute;a que exist&iacute;a una din&aacute;mica para frenar la transparencia, cuando instalamos la transparencia de manera firme y se convirti&oacute; la actividad en una prioridad para nosotros: en dos a&ntilde;os luego de adoptar la normativa de transparencia y rendici&oacute;n de cuentas, hemos alcanzado mejores posiciones&quot; dijo.<br />\r\n<br />\r\nComent&oacute;, que se consideraba a Tonal&aacute; como un municipio atrasado en infraestructura y hoy d&iacute;a desarrolla labores de forma comprometida con Universidades y Sectores Empresariales para hacer de Tonal&aacute; un mejor lugar.<br />\r\n<br />\r\nLa Presidenta del Comit&eacute; de Participaci&oacute;n Social del Sistema Estatal Anticorrupci&oacute;n (CPS), Luc&iacute;a Almaraz C&aacute;zares, manifest&oacute; su alegr&iacute;a por el desarroll&oacute; de trabajos conjuntos con el ITEI y la Contralor&iacute;a del Estado.<br />\r\n<br />\r\n&quot;El CPS se siente en confianza con estas instituciones que consideramos aliadas. La transparencia debe ir de la mano con el control de la corrupci&oacute;n y la iniciativa CoST contempla estos dos aspectos, agradezco a Cynthia Cantero por ser nuestra aliada&quot;, concluy&oacute;.<br />\r\n<br />\r\nLa clausura del evento corri&oacute; a cargo de la Comisionada del INAI, Josefina Rom&aacute;n Vergara.<br />\r\n<br />\r\nEn el evento estuvieron presentes, Mar&iacute;a Teresa Brito Serrano, Contralora del Estado de Jalisco; Guillermo G&oacute;mez Mata, Secretario General de la Universidad de Guadalajara; Jos&eacute; Bautista Far&iacute;as en representaci&oacute;n del Rector Luis Arraiga Valenzuela, SJ, del Instituto Tecnol&oacute;gico y de Estudios Superiores de Occidente, ITESO; Carlos del R&iacute;o Madrigal, Presidente de la C&aacute;mara Mexicana de la Industria de la Construcci&oacute;n Delegaci&oacute;n Jalisco, (CMIC); Bernardo S&aacute;enz Barba, Presidente del Colegio de Ingenieros Civiles del Estado de Jalisco, (CICEJ); Luc&iacute;a Almaraz C&aacute;zares, Presidenta del Comit&eacute; de Participaci&oacute;n Social del Sistema Estatal Anticorrupci&oacute;n del Estado de Jalisco; C&eacute;sar Omar Mora del Colectivo Ciudadanos por Municipios Transparentes, (CIMTRA) y de manera virtual, Miguel &Aacute;ngel Landeros Volquarts, Presidente del Consejo Mexicano de Comercio Exterior de Occidente A.C., (COMCE); Manuel Gonz&aacute;lez Caballero, Gerente Regional Senior para Am&eacute;rica Latina CoST; Edna Jaime Trevi&ntilde;o, Directora General M&eacute;xico Eval&uacute;a, Centro de An&aacute;lisis de Pol&iacute;ticas P&uacute;blicas y los comisionados ciudadanos del ITEI, Pedro Antonio Rosas Hern&aacute;ndez y Salvador Romero Espinosa, al igual que el Secretario Ejecutivo del ITEI, Miguel &Aacute;ngel Hern&aacute;ndez Vel&aacute;zquez.</p>', '2020-10-15 06:00:00', '/news_imgs/1612910672_Boletin3.jpg', 'Publicado', '2021-02-09 23:43:27', '2021-02-09 23:44:32'),
(17, 'Lanzan Plataforma de Divulgación de Obra Pública como parte de la Iniciativa \"CoST Jalisco\"', '<p>La tarde de este d&iacute;a los integrantes del Grupo Multisectorial COST Jalisco, llevaron a cabo en Casa Jalisco, sede del Poder Ejecutivo del Gobierno del Estado de Jalisco, su Primera Sesi&oacute;n Ordinaria 2021, en la que se realiz&oacute; el Lanzamiento formal de la Plataforma de Divulgaci&oacute;n de Obra P&uacute;blica a cargo de Cynthia Cantero Pacheco, qui&eacute;n es Presidente del Grupo Multisectorial en el Estado, y quien explic&oacute; que con esta acci&oacute;n vanguardista, Jalisco se convierte en punta de lanza al transparentar todo el proceso de la Obra P&uacute;blica, desde el inicio hasta su conclusi&oacute;n, incorporando de manera proactiva, informaci&oacute;n que va m&aacute;s all&aacute; de la que se contempla en la Ley de Transparencia:<br />\r\n<br />\r\n&quot;La Plataforma contiene la informaci&oacute;n de 31 obras, que suman: $10,352,644,200.54, de las cuales corresponden: 13 a Gobierno del Estado, 4 de cada uno de los Municipios de Zapopan, Tonal&aacute; y Tlajomulco (12 en total), y 6 del Municipio de Guadalajara&quot; detall&oacute;.<br />\r\n<br />\r\nLa tambi&eacute;n Comisionada del Instituto de Transparencia, Informaci&oacute;n P&uacute;blica y Protecci&oacute;n de Datos Personales en Jalisco (ITEI), Cantero Pacheco, reconoci&oacute; el trabajo y la colaboraci&oacute;n del Gobierno del Estado a trav&eacute;s de la Secretar&iacute;a de Infraestructura y Obra P&uacute;blica.<br />\r\n<br />\r\nPor su parte, el Secretario de Infraestructura y Obra P&uacute;blica del Estado de Jalisco David Miguel Zamora Bueno, asegur&oacute; que para el gobierno actual, la transparencia ha sido una prioridad:<br />\r\n<br />\r\n&quot;Podemos verlos a detalle de manera profesional y sobre todo con el compromiso de seguir haci&eacute;ndolo a lo largo de nuestra administraci&oacute;n, Jalisco vuelve a marcar la pauta en el pa&iacute;s con obras p&uacute;blicas de calidad y transparentes&quot; asegur&oacute;.<br />\r\n<br />\r\nDurante la presentaci&oacute;n se destac&oacute; que el sitio web y la Plataforma fue producto de la colaboraci&oacute;n entre el ITEI y el Banco de Desarrollo de Am&eacute;rica Latina (CAF), que es una instituci&oacute;n financiera multilateral, cuya misi&oacute;n es apoyar el desarrollo sostenible de los pa&iacute;ses accionistas (entre ellos M&eacute;xico) y la integraci&oacute;n de Am&eacute;rica Latina; para lo cual en este proyecto se invirtieron 15,000 quince mil d&oacute;lares y se asegur&oacute; que cumple con el est&aacute;ndar de datos de COST, lo anterior lo expuso la Jefa de miembros del Grupo Multisectorial Evelyn Hern&aacute;ndez:<br />\r\n<br />\r\n&quot;La plataforma cumple con esos 40 puntos de datos que deben divulgarse de manera proactiva y hay que reconocer que este est&aacute;ndar est&aacute; siendo aplicado a nivel global y tiene el reconocimiento de gobiernos del sector privado y la sociedad civil a nivel global&quot; y agreg&oacute; que Jalisco est&aacute; innovando en el uso de un formato que garantiza los datos abiertos:<br />\r\n<br />\r\n&quot;Una forma que va a permitir el uso, re uso y la redistribuci&oacute;n de los datos libremente sin ninguna restricci&oacute;n para cualquier ciudadano, ciudadana en el Estado de Jalisco&quot;<br />\r\n<br />\r\nPor su parte Miguel &Aacute;ngel Landeros Volquarts, Presidente del Consejo Mexicano de Comercio Exterior, reconoci&oacute; la apertura que ha tenido el gobierno de Jalisco y los cuatro gobiernos municipales que forman parte de esta iniciativa de transparencia en infraestructura: Guadalajara, Zapopan, Tonal&aacute; y Tlajomulco de Z&uacute;&ntilde;iga:<br />\r\n<br />\r\n&quot;No es f&aacute;cil la verdad abrir uno de los sectores que siempre han sido los m&aacute;s cuestionados, no es un tema solo de agradecimiento sino de reconocimiento porque eso insisto genera esa confianza que nos hace mucho aqu&iacute; en el Estado&quot; asegur&oacute;.<br />\r\n<br />\r\nPara finalizar, la Comisionada Presidente del Instituto Nacional de Transparencia, Acceso a la Informaci&oacute;n y Protecci&oacute;n de Datos Personales (INAI), Blanca Lilia Ibarra Cadena reconoci&oacute; el liderazgo de Jalisco en esta materia y brind&oacute; todo el respaldo para que estas estrategias se expandan a m&aacute;s Estados y Municipios del Pa&iacute;s:<br />\r\n<br />\r\n&quot;Esta presentaci&oacute;n tambi&eacute;n nos sirva a quienes conformamos el Sistema Nacional de Transparencia a seguir impulsando acciones para que cada vez m&aacute;s municipios y entidades federativas del pa&iacute;s, si as&iacute; lo consideren, adopten estas estrategias y acciones que sirvan para cimentar la construcci&oacute;n de una gesti&oacute;n p&uacute;blica &iacute;ntegra, honesta y cercana a la gente&quot;<br />\r\n<br />\r\nJalisco es miembro de esta iniciativa internacional desde el 2019, actualmente est&aacute; conformada por 15 pa&iacute;ses de cuatro continentes y est&aacute; basada en cuatro partes para su implementaci&oacute;n que comprenden desde, la conformaci&oacute;n de un grupo multisectorial, la divulgaci&oacute;n de proyectos, el aseguramiento de que la informaci&oacute;n sea ver&iacute;dica y finalmente una auditor&iacute;a social<br />\r\n<br />\r\nCabe mencionar que El proyecto fue desarrollado por una empresa 100% Jalisciense: &quot;PICE Software&quot;, que a lo largo de 6 meses (desde septiembre de 2020) trabaj&oacute; de la mano con los enlaces y &aacute;reas de obras p&uacute;blicas para tener los resultados que hoy se presentaron y se pueden consultar en: www.costjalisco.org.mx.</p>', '2021-03-12 06:00:00', '/news_imgs/1615923097_3.jpg', 'Publicado', '2021-03-16 19:51:10', '2021-03-16 20:31:37'),
