(1, 'buyer', 'Comprador', 'Un comprador es una entidad cuyo presupuesto se utilizará para pagar bienes, obras o servicios relacionados con un contrato.', 'OCDS', NULL, NULL),
(2, 'procuringEntity', 'Entidad de adquisición', 'La entidad que está administrando la adquisición. Esta puede ser diferente del comprador que paga, o usa, los artículos que están siendo adquiridos.', 'OCDS', NULL, NULL),
(3, 'supplier', 'Proveedor', 'Una entidad adjudicada o contratada para proveer bienes, obras o servicios.', 'OCDS', NULL, NULL),
(4, 'tenderer', 'Licitante', 'Todas las entidades que presentan una oferta.', 'OCDS', NULL, NULL),
(5, 'funder', 'Financiador', 'El financiador es una entidad que provee dinero o financiamiento para este proceso de contratación o proyecto.', 'OC4IDS', NULL, NULL),
(6, 'enquirer', 'Persona que solicita información', 'Una parte que ha realizado un pedido de información durante la fase de solicitudes de información de un proceso de contratación.', 'OCDS', NULL, NULL),
(7, 'payer', 'Pagador', 'Una parte que hace un pago en una transacción.', 'OCDS', NULL, NULL),
(8, 'payee\r\n\r\n', 'Beneficiario', 'Una parte que recibe un pago en una transacción.', 'OCDS', NULL, NULL),
(9, 'reviewBody', 'Órgano de revisión', 'Una parte responsable de la revisión de este proceso de adquisición. Esta parte tiene a menudo un papel en cualquier cuestionamiento hecho a la adjudicación del contrato.', 'OCDS', NULL, NULL),
(10, 'interestedParty', 'Parte interesada', 'Una parte que ha expresado interés en el proceso de contratación: por ejemplo, comprando documentación del concurso o presentando preguntas aclaratorias.', 'OCDS', NULL, NULL),
(11, 'publicAuthority', 'Autoridad Pública', 'La entidad responsable de desarrollar los activos de infraestructura y/o de entregar los servicios públicos en este proyecto.', 'OC4IDS', NULL, NULL),
(12, 'administrativeEntity', 'Entidad Administrativa', 'La entidad responsable de la administración de contratos.', 'OC4IDS', NULL, NULL);
