INSERT INTO `preparacionobservacion` (`id`, `id_project`, `observaciones`) VALUES
(1, 74, NULL),
(2, 89, 'hola'),
(3, 128, 'si tenía observación'),
(4, 136, 'Sin Obsevaciones'),
(5, 139, 'Sin Obsevaciones'),
(6, 140, 'Sin Obsevaciones'),
(7, 141, 'Sin Obsevaciones'),
(8, 66, NULL),
(9, 157, 'preparación 157'),
(10, 137, 'No requiere de autorización en materia de impacto ambiental, en virtud de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras. Factibilidad: La Unidad Deportiva No. 08 Cuauhtémoc se ubica en la calle San Esteban No. 2095, cruza Francisco Villa en la colonia Talpita. Cuenta con acceso gratuito, se pueden atender entre 50 y 60 mil personas mensualmente. La superficie aproximada de la unidad deportiva es de 2,800 m2. Canchas de uso deportivo en malas condiciones (canchas de futbol, basquetbol, voleibol, frontenis). Baños y vestidores en condiciones deplorables. Las áreas comunes como andadores, áreas de juegos infantiles y ejercitadores también se encuentran en mal estado, al igual que las instalaciones eléctricas e hidrosanitarias. Falta de mantenimiento en los ingresos a la unidad.  El objetivo es renovar la infraestructura de esparcimiento deportivo y recreativo de una de las zonas con mayor densidad de población. Mejorar el equipamiento de canchas para garantizar la calidad deportiva que los compromisos como capital del deporte nos exige y en respuesta al daño generado por los eventos climáticos de los últimos temporales de lluvias.   El proyecto de intervención en este espacio considera solamente la rehabilitación interna de la Unidad Deportiva, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(11, 142, 'No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras. Factibilidad: La plaza Juárez es un espacio emblemático y muy concurrido de la ciudad.  El proyecto se desarrolla a causa de la falta de arbolado y áreas verdes en el entorno urbano así como la falta de rehabilitación de las banquetas que generan un impacto en el ámbito climático, visual, social y de seguridad. Los habitantes no pueden transitar de manera segura por las banquetas y explanadas debido a su mal estado. Las instalaciones eléctricas y de alumbrado se encuentran bastante deterioradas, lo que ocasiona deterioro en la imagen urbana. El objetivo es mejorar las condiciones de uno de los espacios públicos más emblemáticos del Municipio, renovando el entorno urbano, iluminación, banquetas y mobiliario urbano. El proyecto de intervención en este espacio considera solamente la renovación urbana del entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(12, 143, 'No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras. Factibilidad: La Plaza Universidad es un sitio histórico en Guadalajara ubicado en el centro histórico de la ciudad. Esta plaza se encuentra flanqueada por la Biblioteca Iberoamericana Octavio Paz y la avenida Juárez siendo a su vez un punto de convergencia de peatones y comerciantes al tener acceso a la estación “Plaza Universidad” de la línea 2 del sistema de tren eléctrico urbano. El entorno urbano de la Plaza presenta signos de deterioro en varios elementos, como lo son los pisos, fuentes, arriates, mobiliario urbano en desuso, elementos de herrería dañados. El objetivo es renovar las condiciones urbanas de uno de los espacios públicos más emblemáticos de la ciudad, mejorando la iluminación, pisos, arbolado y mobiliario urbano, así como los elementos centrales de la plaza que son las fuentes. El proyecto de intervención en este espacio considera solamente la renovación urbana del entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(13, 144, 'No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras. Factibilidad: En los últimos años, debido a los cierres y desvíos viales derivados de la construcción de la Línea 3 del Tren Ligero,  se ha producido un deterioro en la imagen urbana muy importante en diferentes entornos de dicha obra. El entorno urbano de los Dos Templos no ha sido la excepción, y al ser el límite sur del Paseo Alcalde, es de especial interés la renovación urbana de este espacio. La falta de arbolado y áreas verdes en el entorno urbano así como la falta de rehabilitación de las baquetas y deterioro de los pavimentos, nos genera un impacto en el ámbito climático, visual, social y de seguridad.  Los habitantes no pueden transitar con seguridad por las banquetas por el mal estado de las mismas, y el tener pocas áreas verdes dentro de nuestra urbe nos genera climas más extremos, causando daños directos a los habitantes. Las instalaciones eléctricas y de alumbrado, así como las de los servicios de voz y datos se encuentran de manera aérea, lo que ocasiona deterioro en la imagen urbana. El objetivo es consolidar el sur del Paseo Alcalde como remate de los dos templos, renovando la imagen urbana, banquetas y plazoleta promoviendo un rescate de una de las zonas afectadas por los trabajos de la Línea 3 del Tren Ligero. El proyecto de intervención en este espacio considera solamente la renovación urbana del entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
