solamente la renovación urbana del entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(16, 39, 'Se adjuntan 43 estudios RNP o Radio Network Planning que determinan la factibilidad de instalación o habilitación de Radio Bases'),
(17, 148, 'La extensión de la Unidad de Construcción de la Dirección de Obras Públicas e Infraestructura es 3170.  Los beneficiarios indicados son los directamente beneficiados con la obra, sin embargo, indirectamente la obra beneficia a los ciudadanos que transitan por la localidad.  Se incluyen el plano del Proyecto correspondiente al contrato DOPI-MUN-R33-ELE-CI-062-2019.'),
(18, 149, 'En el Programa de Inversión 2019 de la Dirección de Obras Públicas y Proyectos para el ejercicio fiscal 2019, numeral XII del Presupuesto de Egresos 2019, no es posible identificar la obra, pues en el caso del Fondo para la Infraestructura Social (FAIS) y el Fondo de Aportaciones para el Fortalecimiento de los Municipios y de las Demarcaciones Territoriales del Distrito Federal (FORTAMUN), las obras se seleccionan con posterioridad debido a que el recurso se determina anualmente en el Presupuesto de Egresos de la Federación, pero en el programa se hace un estimado y en cada caso se observa:  FAIS: La selección de obras se hace en función de los Lineamientos del Fondo de Aportaciones para la Infraestructura Social, mismos que especifican que los recursos son exclusivamente para el financiamiento de obras, acciones sociales básicas e inversiones que beneficien directamente a población en pobreza extrema, localidades con alto o muy alto nivel de rezago social conforme a lo previsto en la Ley General de Desarrollo Social (LGDS) y en Zonas de Atención Prioritaria (ZAP). FORTAMUN: Los recursos se destinan a la satisfacción de los requerimientos de los Municipios y de las Demarcaciones Territoriales, dando prioridad al cumplimiento de sus obligaciones financieras, al pago de derechos y aprovechamientos por concepto de agua, descargas de aguas residuales, a la modernización de los sistemas de recaudación locales, mantenimiento de infraestructura, y a la atención de las necesidades directamente vinculadas con la seguridad pública de sus habitantes. Derivado de lo anterior se adjunta tanto la asignación de los recursos FAIS y FORTAMUN, como el acta donde se da cuenta del proyecto de obras y el acta de la sesión de COPPLADEMUN en la que se da a conocer el listado de obras FAIS.'),
