(20, 147, 'En el Programa de Inversión 2019 de la Dirección de Obras Públicas y Proyectos para el ejercicio fiscal 2019, numeral XII del Presupuesto de Egresos 2019, no es posible identificar la obra, pues en el caso del Fondo para la Infraestructura Social (FAIS) y el Fondo de Aportaciones para el Fortalecimiento de los Municipios y de las Demarcaciones Territoriales del Distrito Federal (FORTAMUN), las obras se seleccionan con posterioridad debido a que el recurso se determina anualmente en el Presupuesto de Egresos de la Federación, pero en el programa se hace un estimado y en cada caso se observa:  FAIS: La selección de obras se hace en función de los Lineamientos del Fondo de Aportaciones para la Infraestructura Social, mismos que especifican que los recursos son exclusivamente para el financiamiento de obras, acciones sociales básicas e inversiones que beneficien directamente a población en pobreza extrema, localidades con alto o muy alto nivel de rezago social conforme a lo previsto en la Ley General de Desarrollo Social (LGDS) y en Zonas de Atención Prioritaria (ZAP). FORTAMUN: Los recursos se destinan a la satisfacción de los requerimientos de los Municipios y de las Demarcaciones Territoriales, dando prioridad al cumplimiento de sus obligaciones financieras, al pago de derechos y aprovechamientos por concepto de agua, descargas de aguas residuales, a la modernización de los sistemas de recaudación locales, mantenimiento de infraestructura, y a la atención de las necesidades directamente vinculadas con la seguridad pública de sus habitantes. Derivado de lo anterior se adjunta tanto la asignación de los recursos FAIS y FORTAMUN, como el acta donde se da cuenta del proyecto de obras y el acta de la sesión de COPPLADEMUN en la que se da a conocer el listado de obras FAIS.'),
(21, 212, 'Autorización en materia de impacto ambiental:  No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras.  Estudio de factibilidad:  La unidad deportiva No. 08 Cuauhtémoc (Talpita) se ubica en la calle San Esteban No. 2095, cruza Francisco Villa en la colonia Talpita. Cuenta con acceso gratuito y se pueden atender entre 50 y 60 mil personas mensualmente. La superficie aproximada de la unidad deportiva es de 2,800 m2. Cuenta con canchas de uso deportivo en malas condiciones (canchas de futbol, basquetbol, voleibol, frontenis), baños y vestidores en condiciones deplorables. Las áreas comunes como andadores áreas de juegos infantiles y ejercitadores también se encuentran en mal estado, al igual que las instalaciones eléctricas e hidrosanitarias. Asimismo falta de mantenimiento en los ingresos a la unidad.    El objetivo es renovar la infraestructura de esparcimiento deportivo y recreativo de una de las zonas con mayor densidad de población. Mejorar el equipamiento de canchas para garantizar la calidad deportiva que los compromisos como capital del deporte nos exige y en respuesta al daño generado por los eventos climáticos de los últimos temporales de lluvias.  Impacto del terreno y asentamientos:  El proyecto de intervención en este espacio considera solamente la rehabilitación interna de la Unidad Deportiva, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(22, 213, 'Autorización en materia de impacto ambiental:  No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras.  Estudio de factibilidad:  La Unidad Deportiva No. 56 Jorge \"Chorejas\" Bravo se ubica en domicilio calle Fuelle no. 1908 esq. Taladro col. Álamo Industrial, es de acceso gratuito y se pueden atender entre 30 y 40 mil personas mensualmente. Cuenta con una superficie aproximada de 2,000 m2, canchas de uso deportivo en malas condiciones (canchas de futbol, basquetbol, voleibol, frontenis), baños y vestidores en condiciones deplorables, áreas comunes como andadores áreas de juegos infantiles y ejercitadores en mal estado al igual que las instalaciones eléctricas e hidrosanitarias. Asimismo falta de mantenimiento en los ingresos a la unidad.  El objetivo es renovar los servicios, instalaciones y equipamiento en la unidad deportiva con el propósito de ofrecer un espacio con calidad para el esparcimiento, recreación y realización de actividades físicas y de convivencia familiar. Incrementar la participación de la población en actividades deportivas, recreativas y de interacción social, mejorando la calidad de vida de los habitantes, ya que la práctica del deporte incide directamente en una mejor calidad de vida y se convierte en expresión del desarrollo y bienestar de una sociedad.  Impacto del terreno y asentamientos:  El proyecto de intervención en este espacio considera solamente la rehabilitación interna de la Unidad Deportiva, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(23, 214, 'Autorización en materia de impacto ambiental:  No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras.  Estudio de factibilidad:  En la actualidad, la superficie de rodamiento de las calle 5 (entre calle 10 y calle 8) y calle 12A (entre Lázaro Cárdenas y Gobernador Curiel), en la colonia Ferrocarril, se encuentra sumamente deteriorada, con múltiples deformaciones y baches, así como disgregamiento de materiales asfalticos, brindando un nivel de servicio para rodamiento muy malo, además de hacerlas inseguras a la circulación de todo tipo de vehículos y generando congestionamientos viales recurrentes.  La demanda del uso diario de estas vialidades se ve afectada por los daños en la superficie de rodamiento existente, lo que genera una disminución de la velocidad promedio de los vehículos que transitan y una baja de eficiencia en su operación, lo que representa desgaste vehicular, altos niveles de contaminación y un aumento en pérdidas de horas - hombre.  El objetivo del proyecto  es la sustitución de redes hidrosanitarias, la rehabilitación de los pavimentos, banquetas, la generación de cruces seguros y la renovación del alumbrado público, lo que genera, sin duda, el mejoramiento del entorno urbano, lo que hace más atractivo su uso y garantiza la integridad de los usuarios. Asimismo, con la conclusión del proyecto se reducirán los CGVs por eliminar las fallas estructurales del pavimento, se incrementará la velocidad de traslado, se reducirán los desgastes de los vehículos, se reducirán los tiempos de recorrido y se incrementa la seguridad de los usuarios.  Impacto del terreno y asentamientos:  El proyecto de intervención en este espacio considera solamente la renovación de las calles y el entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(24, 215, 'Autorización en materia de impacto ambiental:  No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras.  Estudio de factibilidad:  En la actualidad, la superficie de rodamiento de las calle 5 (entre calle 10 y calle 8) y calle 12A (entre Lázaro Cárdenas y Gobernador Curiel), en la colonia Ferrocarril, se encuentra sumamente deteriorada, con múltiples deformaciones y baches, así como disgregamiento de materiales asfalticos, brindando un nivel de servicio para rodamiento muy malo, además de hacerlas inseguras a la circulación de todo tipo de vehículos y generando congestionamientos viales recurrentes.  La demanda del uso diario de estas vialidades se ve afectada por los daños en la superficie de rodamiento existente, lo que genera una disminución de la velocidad promedio de los vehículos que transitan y una baja de eficiencia en su operación, lo que representa desgaste vehicular, altos niveles de contaminación y un aumento en pérdidas de horas - hombre.  El objetivo del proyecto  es la sustitución de redes hidrosanitarias, la rehabilitación de los pavimentos, banquetas, la generación de cruces seguros y la renovación del alumbrado público, lo que genera, sin duda, el mejoramiento del entorno urbano, lo que hace más atractivo su uso y garantiza la integridad de los usuarios. Asimismo, con la conclusión del proyecto se reducirán los CGVs por eliminar las fallas estructurales del pavimento, se incrementará la velocidad de traslado, se reducirán los desgastes de los vehículos, se reducirán los tiempos de recorrido y se incrementa la seguridad de los usuarios.  Impacto del terreno y asentamientos:  El proyecto de intervención en este espacio considera solamente la renovación de las calles y el entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
(25, 216, 'Autorización en materia de impacto ambiental:  No requiere de autorización en materia de impacto ambiental, a razón de que los impactos que pudieran generarse por la realización de la obra en cuestión, son benéficos y permanentes, ya que el área del proyecto es una zona previamente impactada por actividades de tipo antropogénico, considerando el deterioro ambiental que prevalecía sobre el sitio no se prevé que el desarrollo del proyecto genere o pueda haber generado impactos adversos significativos que pudieran causar desequilibrios ecológicos. Los fundamentos del proyecto son congruentes con los principios del desarrollo ecológico sustentable, ya que cumple con la premisa establecida en la Constitución Política de los Estados Unidos Mexicanos, que refiere a la preservación y restauración del equilibrio ecológico y protección al ambiente, la Ley General del Equilibrio Ecológico y la Protección al Ambiente, presenta disposiciones de orden público e interés social teniendo por objeto propiciar el desarrollo sustentable y establecer bases para garantizar el derecho de toda persona a vivir en un medio ambiente adecuado para su desarrollo, salud y bienestar entre otras.  Estudio de factibilidad:  Actualmente, la Av. de la Escultura (Cuerpo Sur, entre J. Glez. Camarena y  Gobernador Curiel) y la calle Alberto Durero (entre Av. de la Pintura y Av. de la Escultura) en la colonia Miravalle, cuentan con superficie de rodamiento de pavimento asfáltico y se encuentra en mal estado, con alta presencia de baches y desprendimiento de la superficie de rodamiento, con IRI de 8.5 m/km. Las banquetas  tienen un ancho promedio de 2 metros y son de concreto y no cuentan con criterios de accesibilidad universal. La infraestructura para dotar los servicios de agua potable y drenaje se encuentran en mal estado debido a la edad de la misma, presentando fugas. La infraestructura de alumbrado público también se encuentra en mal estado.   El objetivo del proyecto  es la sustitución de redes hidrosanitarias, la rehabilitación de los pavimentos, banquetas, la generación de cruces seguros y la renovación del alumbrado público, lo que genera, sin duda, el mejoramiento del entorno urbano, hace más atractivo su uso y garantiza la integridad de los usuarios.   Asimismo, con la conclusión del proyecto se reducirán los CGVs por eliminar las fallas estructurales del pavimento, se incrementará la velocidad de traslado, se reducirán los desgastes de los vehículos, se reducirán los tiempos de recorrido y se incrementa la seguridad de los usuarios.   Impacto del terreno y asentamientos:  El proyecto de intervención en este espacio considera solamente la renovación de las calles y el entorno, no se tiene contemplado el uso de nuevos espacios ni el cambio de su uso de suelo. Por lo consiguiente, no se generan impactos negativos ni en el propio terreno ni en los asentamientos próximos.'),
