(39, 'SIOP-E-REDJAL-OB-LP-952-2019', '2021-10-28 00:00:00', 'RED JALISCO, RED ESTATAL DIGITAL', 'Infraestructura en telecomunicaciones para los municipios del Estado (Red Jalisco). Diseño, estudios básicos, proyecto ejecutivo, construcción, equipamiento, puesta en marcha y mantenimiento.', 4, 80, NULL, 4, 49, 'Ampliar la cobertura de conectividad, disminuir la brecha Digital, potenciar las regiones del Estado', 1, 7100000, NULL, 'El domicilio principal de la obra se ubica en Alcalde 1221, Colonia Miraflores, C.P. 44270, Guadalajara, Jalisco, sitio donde se encuentra el Centro de Operaciones de la Red. Actualmente el proyecto se encuentra con los siguientes avances: Etapa 1, Etapa Preparatoria, diseño, estudios básicos y proyecto ejecutivo: 100%; Etapa 2, Etapa de Construcción, equipamiento y puesta en marcha: 95%; Etapa 3, Etapa de Servicio y Mantenimiento: 0%; Etapa 4, Etapa de Entrega de la Red: 0%; lo que representa un 80% global. El proyecto Red Jalisco considera 12,000 sitios como potenciales candidatos a tener conectividad (usuarios finales), susceptibles a corroborar la factibilidad técnica y condiciones físicas del inmueble, así como la verificación de que se encuentren actualmente operando.  Se cuenta con sitios adicionales para sustitución en caso de que algunos sitios considerados originalmente no cumplan con los requerimientos necesarios.  No se presentan los sitios que derivado de sus particularidades revisten el carácter de reservado de conformidad al artículo 17.1, fracción I, incisos a), c) y f) de la Ley de Transparencia y Acceso a la Información Pública del Estado de Jalisco y sus Municipios; en correlación con el artículo 113 fracción I, V y VII de la Ley General de Transparencia y Acceso a la Información Pública.  La población beneficiada con el proyecto incluye estudiantes, personal docente, trabajadores y usuarios de edificios de gobierno, conductores de automotores, público en general y efectos para seguridad ciudadana.', NULL, NULL, NULL, '', 2, NULL, '2021-01-20 18:58:28', '2021-10-29 00:11:32'),
