INSERT INTO `projectstatus` (`id`, `codigo`, `titulo`, `descripcion`, `created_at`, `updated_at`) VALUES
(1, 'identification', 'Identificación', 'Identificación se refiere a la decisión de desarrollar un proyecto dentro del presupuesto y programa de un dueño del proyecto (la entidad pública responsable de ejecutar el presupuesto).', NULL, NULL),
(2, 'preparation', 'Preparación', 'La preparación cubre el estudio de factibilidad, la evaluación del impacto medioambiental y social, el alcance general del proyecto, el marco y la estrategia de adquisiciones, requerimientos legales preliminares sobre el impacto medioambiental y el terreno, y la resultante actualización del presupuesto.', NULL, NULL),
(3, 'implementation', 'Implementación', 'La implementación cubre las adquisiciones y la implementación del conjunto de trabajos o servicios (tales como diseño y supervisión) a ser entregados bajo el proyecto, incluyendo trabajos o servicios realizados por la entidad compradora. Esto difiere de la definición de “implementación” en OCDS, que cubre la implementación pero no las adquisiciones.', NULL, NULL),
(4, 'completion', 'Finalización', 'La finalización cubre el traspaso de los activos y las actividades de cierre con detalles del alcance, costo y fecha de entrega finales.', NULL, NULL),
(5, 'completed', 'Completado', 'Las actividades de cierre fueron completadas y este proyecto está inactivo.', NULL, NULL),
(6, 'cancelled', 'Cancelado', 'Este proyecto fue cancelado antes de que las actividades de cierre fueran completadas, y está inactivo. La cancelación puede ocurrir en cualquier momento después de la identificación.', NULL, NULL),
(7, 'identification', 'Datos Generales', NULL, NULL, NULL);
